import { Component, OnInit, ElementRef, ViewChild, AfterViewInit } from '@angular/core';
import { DlcService } from './dlc.service';
import { PostFramesRequest } from './model/post-frames-request.model';
import { Observable } from 'rxjs';

@Component({
  selector: 'app-dlc-annotate',
  templateUrl: './dlc-annotate.component.html',
  styleUrls: ['./dlc-annotate.component.css']
})
export class DlcAnnotateComponent implements AfterViewInit {
  
  @ViewChild('canvas', {
    static: false
  }) canvasRef: ElementRef;
  public context: CanvasRenderingContext2D;

  private labels : AnnotationLabel[] = [{name: "head", color:"blue"},
                                {name: "eyes", color:"red"},
                                {name: "label 3", color:"green"},
                                {name: "label 4", color:"yellow"}];
                                
  private annotatedFrames : LocalAnnotatedFrame[] = [];
  private recievedFrames : AnnotatedFrame[] = [];
  private currentLabel : AnnotationLabel;
  private currentFrame : number = 0;

  constructor(private service: DlcService) {

  }

  ngAfterViewInit() { 
    this.context = (this.canvasRef.nativeElement as HTMLCanvasElement).getContext('2d');
    this.context.font = "20px sans-serif";
    this.context.textAlign = "center";
    this.context.fillText("No Frames Loaded", this.canvasRef.nativeElement.width/2, this.canvasRef.nativeElement.height/2);
    this.currentLabel = this.labels.length > 0 ? this.labels[0] : new AnnotationLabel("defaultLabel", "red"); 
    this.loadFrames();
    if (this.annotatedFrames.length < 0) {
      var image1 = "data:image/jpeg;base64,";
      var image2 = "data:image/jpeg;base64,";
      
      this.annotatedFrames.push(new LocalAnnotatedFrame(
        "ebb841dc-6075-4072-bc05-09439b53c5b2",
        this.base64ToImage(image1),
        []
      ));
      this.annotatedFrames.push(new LocalAnnotatedFrame(
        "ebb841dc-6075-4072-bc05-09439b53c5b2",
        this.base64ToImage(image2),
        []
       ));

      this.recievedFrames.push(new AnnotatedFrame(
        "ebb841dc-6075-4072-bc05-09439b53c5b2",
        image1,
         []
       ));
       this.recievedFrames.push(new AnnotatedFrame(
        "ebb841dc-6075-4072-bc05-09439b53c5b2",
         image2,
         []
       ));
    }
  }

  loadFrames() {
    this.service.getFrames("c41f25f1-4dbf-4ec3-a92c-8e7142764b64").subscribe(
      res => {
        console.log(res);
        res.forEach(f => {
          this.recievedFrames.push(new AnnotatedFrame(
            f.imageId,
            f.image,
            []
          ));
          this.annotatedFrames.push(new LocalAnnotatedFrame(
            f.imageId,
            this.base64ToImage(f.image),
            f.annotations
          ))
        })
      }
    )
  }

  annotate(e) {
    this.annotatedFrames[this.currentFrame].annotations.push(new Annotation(e.layerX-2, e.layerY-3, this.currentLabel));
    this.refreshImage();
  }

  refreshImage() {
    this.context.drawImage(this.annotatedFrames[this.currentFrame].image,0,0);
    this.annotatedFrames[this.currentFrame].annotations.forEach(annotation => {
      this.context.fillStyle = annotation.label.color;
      this.context.beginPath();
      this.context.arc(annotation.x, annotation.y, 4, 0, 2 * Math.PI);
      this.context.fill();
    });
  }

  nextFrame() {
    this.currentFrame + 1 >= this.annotatedFrames.length ? this.currentFrame = 0 : this.currentFrame = this.currentFrame + 1;
    this.refreshImage();
  }

  prevFrame() {
    this.currentFrame <= 0 ? this.currentFrame = this.annotatedFrames.length - 1 : this.currentFrame = this.currentFrame - 1;
    this.refreshImage();
  }

  erase() {
    this.annotatedFrames[this.currentFrame].annotations = [];
    this.refreshImage();
  }

  save() {
    let request = {
      frames: this.mapLocalToRequest(this.annotatedFrames),
      userId:"c41f25f1-4dbf-4ec3-a92c-8e7142764b64",
      projectId:"c41f25f1-4dbf-4ec3-a92c-8e7142764b64"
    }
    console.log("saving...");
    this.service.postFrames(request).subscribe(res => {console.log(res);});
  }

  selectLabel(name: string) {
    this.labels.forEach(label => {
      if (label.name == name) {this.currentLabel = label;}
    });
  }
  
  base64ToImage(b64: string): HTMLImageElement {
    var image = new Image();
    image.src = b64;
    return image;
  }

  mapLocalToRequest(frames: LocalAnnotatedFrame[]) {
    let newFrames: AnnotatedFrame[] = [];
    frames.forEach((f, i) => {
      newFrames.push(
        new AnnotatedFrame(f.imageId, this.recievedFrames[i].image, f.annotations)
      )
    })
    return newFrames;
  }
}

class AnnotationLabel {
  name: string;
  color: string;

  constructor(name: string, color: string) {
    this.name = name;
    this.color = color;
  }
}

export class AnnotatedFrame {
  imageId: string;
  image: string;
  annotations: Annotation[];

  constructor(imageId: string, image: string, annotations: Annotation[]) {
    this.imageId = imageId;
    this.image = image;
    this.annotations = annotations;
  }
}

class LocalAnnotatedFrame {
  imageId: string;
  image: HTMLImageElement;
  annotations: Annotation[];

  constructor(imageId: string, image: HTMLImageElement, annotations: Annotation[]) {
    this.imageId = imageId;
    this.image = image;
    this.annotations = annotations;
  }
}

class Annotation {
  x: number;
  y: number;
  label: AnnotationLabel;

  constructor(x: number, y: number, label: AnnotationLabel) {
    this.x = x;
    this.y = y;
    this.label = label;
  }
}